var title_f9_19_9532="Etiologies of expressive delay";
var content_f9_19_9532=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F50911&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F50911&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Selected causes of and contributing factors to expressive language delay in young children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Cause/Contributing factor",
"       </td>",
"       <td class=\"subtitle1\">",
"        Examples",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maturational language delay* (constitutional language delay)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hearing impairment",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prematurity and/or low birth weight",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Infectious diseases",
"       </td>",
"       <td>",
"        Intrauterine infection, meningitis, HIV/AIDS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic conditions",
"       </td>",
"       <td>",
"        Seizures, cerebral palsy, apraxia of speech, etc.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metabolic conditions",
"       </td>",
"       <td>",
"        Hypothyroidism, phenylketonuria, etc.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Toxicologic conditions",
"       </td>",
"       <td>",
"        Lead poisoning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Genetic conditions",
"       </td>",
"       <td>",
"        Down syndrome, fragile X syndrome, Williams syndrome, neurofibromatosis, tuberous sclerosis, etc.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Family history",
"       </td>",
"       <td>",
"        Language delay, learning problems, dyslexia, cognitive disability, etc.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Socioeconomic factors",
"       </td>",
"       <td>",
"        Poverty, low parental educational attainment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lack of language stimulation, parent-child dysfunction, or disruption in parenting",
"       </td>",
"       <td>",
"        Maternal depression, child neglect or abuse, time spent in an orphanage, multiple foster care placements, etc.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Maturational language delay is a diagnosis made in younger children who are in the early developmental period. These delays may resolve in some children or progress to a more specific diagnosis by the age of school entry. However, making the functional diagnosis of maturational language delay may allow the child to receive treatment services while the other causes of language delay are being evaluated.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
