"   <div class=\"lgnd\">",
"    This schematic drawing of the basal ganglia and their connections illustrates the main striato-fugal pathways. In PD, the inhibitory direct pathway mediated via D2 striatal receptors has been postulated to be overactive whereas the inhibitory direct mediated via D1 striatal receptors has been underactive as a result of which the main outflow pallidal-thalamic pathway provides inhibitory input to the thalamus and results in suppression of thalamo-cortical-spinal pathway manifested clinically by paucity and slowness of movement (bradykinesia). In contrast, the abnormal function in the basal ganglia of hyperkinetic movement disorders presumably leads to disinhibition of the thalamo-cortical-striatal pathway manifested clinically by excessive abnormal involuntary movements such as chorea, hemiballism (HB), tics as seen in Tourette syndrome (TS), and dystonia.",
